    <td><![endif]>
    <div>
    <p class=papertitle style='mso-margin-top-alt:auto;mso-margin-bottom-alt:
    auto;text-align:justify'><span lang=EN-US style='font-size:12.0pt;
    font-family:"Arial",sans-serif'>For this, it is necessary to start from the
    conceptual idea of &#8203;&#8203;the system to be developed, and for this,
    the need for a system that allows generating temperature ramps from room
    temperature to about 120C of temperature is defined [2]. Some requirements
    are that the volume and pressure are constant and that the system is closed
    to allow measuring sensors, devices, biological material and their
    responses in temperature with constant pressure and volume conditions and
    thus find the mass (only applies to biological materials). On the other
    hand, the system must allow going from room temperature to -10 C to test
    other materials or liquids and see if fractures are created [3]. The system
    must be able to go from high to low temperature, and from low to high, also
    allowing stability at a temperature over time. <o:p></o:p></span></p>
    <p class=papertitle style='mso-margin-top-alt:auto;mso-margin-bottom-alt:
    auto;text-align:justify'><span lang=EN-US style='font-size:12.0pt;
    font-family:"Arial",sans-serif'>In addition to all this, applications such
    as incubation periods of biological material, temperature ramps,
    temperature inversion and stability for periods, creation of controlled
    disturbances, maximum and minimum values, all these conditions must be
    considered [4]. Other aspects also come into play, such as costs and the
    public to whom the development is directed.</span><span lang=EN-US
    style='font-size:12.0pt;mso-bidi-font-size:11.0pt;font-family:"Calibri",sans-serif;
    mso-ascii-theme-font:minor-latin;mso-hansi-theme-font:minor-latin;
    mso-bidi-font-family:"Times New Roman";mso-bidi-theme-font:minor-bidi;
    mso-bevel-captop-bevelstyle:12;mso-bevel-captop-dpiwidth:4.5pt;mso-bevel-captop-dpiheight:
    3.0pt;mso-bevel-capbot-bevelstyle:0;mso-bevel-capbot-dpiwidth:0pt;
    mso-bevel-capbot-dpiheight:0pt;mso-bevel-material:8;mso-bevel-dpiextrusion:
    4.5pt;mso-bevel-dpicontour:0pt'><o:p></o:p></span></p>
    </div>

    <p class=papertitle style='margin-bottom:0cm;margin-bottom:.0001pt;
    text-align:justify;line-height:115%'><span lang=EN-US style='font-size:
    12.0pt;line-height:115%;font-family:"Arial",sans-serif;mso-fareast-font-family:
    SimSun'>The developed system is based on a closed container with a
    transient air flow, in order to determine at certain times in a confined
    and known space, a thermal condition that allows us to make measurements
    under controlled and stable conditions, however the thermodynamic laws of
    energy and matter exchange are applied since the system takes and exchanges
    these conditions frequently. In this case there are exchanges of energy
    between hot and cold objects or air, vapor and oxygen molecules </span><span
    lang=EN-US style='font-size:12.0pt;line-height:115%;font-family:"Arial",sans-serif'>[6]</span><span
    lang=EN-US style='font-size:12.0pt;line-height:115%;font-family:"Arial",sans-serif;
    mso-fareast-font-family:SimSun'>.<o:p></o:p></span></p>

    <p class=MsoListParagraph style='margin-left:0cm;mso-add-space:auto;
    text-align:justify;line-height:115%'><span lang=EN-US style='font-size:
    12.0pt;line-height:115%;font-family:"Arial",sans-serif'>For the initial
    state, the constant volume of the container is considered as known, the
    medium will be air because variables such as density, temperature and
    humidity are equal inside and outside the chamber in the first interval
    from room temperature to 60 C. The 5 watts electric heating element (Ra)
    is the actuator in this temperature zone, then the 150-watt electric heating
    element to heat the systems up to 200C and finally the cooling effect (<span
    class=SpellE>Rc</span>). It is better to let the system start from rest at
    room temperature, using equation 1, [8].</span><span lang=EN-US
    style='font-size:12.0pt;mso-bidi-font-size:11.0pt;line-height:115%;
    mso-ascii-font-family:Calibri;mso-ascii-theme-font:minor-latin;mso-hansi-font-family:

  <![if !mso]>

   <tr>
    <td><![endif]>
    <div>
    <p class=papertitle style='mso-margin-top-alt:auto;mso-margin-bottom-alt:
    auto;text-align:justify'><span lang=EN-US style='font-size:12.0pt;
    font-family:"Arial",sans-serif'>In order to observe the dynamic behavior
    and inertia of the system, data was captured in different scenarios. The first
    scenario consisted in heating the air with the low-power resistance (5
    watts). The second in heating the air with the high-power resistance (150
    watts). The third was to cool naturally by disconnecting the heaters until
    reaching ambient temperature (the slope of the temperature versus time
    curve is moderate and governed by the heat losses through the walls of the
    container). Finally, the fourth scenario consisted of the cooling process
    through the Peltier modules [10].<o:p></o:p></span></p>
    <p class=papertitle style='mso-margin-top-alt:auto;mso-margin-bottom-alt:
    auto;text-align:justify'><span lang=EN-US style='font-size:12.0pt;
    mso-bidi-font-size:11.0pt;font-family:"Calibri",sans-serif;mso-ascii-theme-font:

    mso-bidi-theme-font:minor-bidi;mso-bevel-captop-bevelstyle:12;mso-bevel-captop-dpiwidth:
    4.5pt;mso-bevel-captop-dpiheight:3.0pt;mso-bevel-capbot-bevelstyle:0;

    <p class=papertitle style='mso-margin-top-alt:auto;mso-margin-bottom-alt:
    auto;text-align:justify'><span lang=EN-US style='font-size:12.0pt;
    font-family:"Arial",sans-serif'>Before making the physical model it is
    necessary to present a little the idea with some implements that are
    available, to see the feasibility and see if the realization would be
    possible, it is like a small materialization of the idea, to then produce
    the physical model comprises several aspects of utmost importance: the
    first consists of finding the dynamic characteristics of the system
    according to mathematical theory, in a case like this it is necessary to
    model the thermal system first, then follow the experimental developments
    and obtain the values &#8203;&#8203;&#8203;&#8203;of the previous tables of
    the system or the plant; to then make approximations under valid criteria
    that simplify the result obtained [9].<o:p></o:p></span></p>

    <p class=MsoNormal style='text-align:justify;line-height:115%'><span
    lang=EN-US style='font-size:12.0pt;line-height:115%;font-family:"Arial",sans-serif'>The
    main idea to model this system is to start from the first law of
    thermodynamics on the conservation of energy, equating the heat Q=W, where
    Q is the heat supplied by the system to the medium (container) and W is the
    work done by the medium (container) to the system during the cycle.<o:p></o:p></span></p>

    <div>
    <p class=papertitle style='mso-margin-top-alt:auto;mso-margin-bottom-alt:
    auto;text-align:justify'><span lang=EN-US style='font-size:12.0pt;
    font-family:"Arial",sans-serif'>In order to generate a modeling theory for
    a system like this, it is necessary once the conceptual idea, the
    phenomena, the variables and some aspects of operation are known, the next
    objective is to model a system, to characterize it mathematically and find
    a way to describe it more thoroughly in a more complete, precise, detailed
    and exact way, with all this information it will be used to perform
    analyses and generate all of the automatic controllers and also the
    algorithms seeking that the operation is adapted to the requirements
    proposed for the interested public. It is essential to obtain physical data
    and numbers for the mathematical model, in this case table 5 shows the
    container, volume, weight, area and some properties in our case it consists
    of a series of equations that represent the behavior of the system, a
    thermal or thermodynamic section, another section on electronic design and device
    control, another section on control algorithms, proportional, integral and
    derivative, as can be seen all these equations do not represent a single
    model, each one has different representations on the system but they act in
    a different way, table 3 shows for example the heats of skin, blood, bones
    and muscles [5].</span><span lang=EN-US style='font-size:12.0pt;mso-bidi-font-size:
    24.0pt;font-family:"Calibri",sans-serif;mso-ascii-theme-font:minor-latin;

  <td colspan=36 align=left valign=top><img width=719 height=109
  src="Teorical_Model_file/image022.png"
  alt="Elaborazione alternativa: In order to provide a theoretical model of the proposed system, it is necessary to identify the result that is desired to be obtained. In this way, a series of data can be provided that will help produce this model. Table 1 presents some essential and required data that allow the selection of materials, control elements, sensors and final control elements [1].&#13;&#10;&#13;&#10;"

 <tr>
  <td height=333></td>
  <td colspan=11></td>
  <td colspan=35 align=left valign=top><img width=711 height=333
  src="Teorical_Model_file/image024.png"
  alt="Elaborazione alternativa: For this, it is necessary to start from the conceptual idea of the system to be developed, and for this, the need for a system that allows generating temperature ramps from room temperature to about 120C of temperature is defined [2]. Some requirements are that the volume and pressure are constant and that the system is closed to allow measuring sensors, devices, biological material and their responses in temperature with constant pressure and volume conditions and thus find the mass (only applies to biological materials). On the other hand, the system must allow going from room temperature to -10 C to test other materials or liquids and see if fractures are created [3]. The system must be able to go from high to low temperature, and from low to high, also allowing stability at a temperature over time. &#13;&#10;In addition to all this, applications such as incubation periods of biological material, temperature ramps, temperature inversion and stability for periods, creation of controlled disturbances, maximum and minimum values, all these conditions must be considered [4]. Other aspects also come into play, such as costs and the public to whom the development is directed.&#13;&#10;"
  v:shapes="_x0000_s1033"></td>
 </tr>

  <td height=13></td>

  alt="Elaborazione alternativa: Knowing the previous requirement, the elements that will make up the system, their integration and the probability of operation can be selected. In this case, the creation of a table with parameters is required to be able to select the sensors and other elements. This entire section stops being a theory and becomes a technical aspect where the sensors, actuators and devices are selected.&#13;&#10;&#13;&#10;"
  v:shapes="_x0000_s1032"></td>

  <td height=316></td>
  <td colspan=8></td>
  <td colspan=36 align=left valign=top><img width=720 height=316
  src="Teorical_Model_file/image030.png"
  alt="Elaborazione alternativa: In order to generate a modeling theory for a system like this, it is necessary once the conceptual idea, the phenomena, the variables and some aspects of operation are known, the next objective is to model a system, to characterize it mathematically and find a way to describe it more thoroughly in a more complete, precise, detailed and exact way, with all this information it will be used to perform analyses and generate all of the automatic controllers and also the algorithms seeking that the operation is adapted to the requirements proposed for the interested public. It is essential to obtain physical data and numbers for the mathematical model, in this case table 5 shows the container, volume, weight, area and some properties in our case it consists of a series of equations that represent the behavior of the system, a thermal or thermodynamic section, another section on electronic design and device control, another section on control algorithms, proportional, integral and derivative, as can be seen all these equations do not represent a single model, each one has different representations on the system but they act in a different way, table 3 shows for example the heats of skin, blood, bones and muscles [5].&#13;&#10;&#13;&#10;"
  v:shapes="_x0000_s1043"></td>

  src="Teorical_Model_file/image032.png"
  alt="Elaborazione alternativa: The developed system is based on a closed container with a transient air flow, in order to determine at certain times in a confined and known space, a thermal condition that allows us to make measurements under controlled and stable conditions, however the thermodynamic laws of energy and matter exchange are applied since the system takes and exchanges these conditions frequently. In this case there are exchanges of energy between hot and cold objects or air, vapor and oxygen molecules [6].&#13;&#10;&#13;&#10;"

  src="Teorical_Model_file/image036.png"
  alt="Elaborazione alternativa: The main idea to model this system is to start from the first law of thermodynamics on the conservation of energy, equating the heat Q=W, where Q is the heat supplied by the system to the medium (container) and W is the work done by the medium (container) to the system during the cycle.&#13;&#10;&#13;&#10;"

  src="Teorical_Model_file/image038.png"
  alt="Elaborazione alternativa: For the initial state, the constant volume of the container is considered as known, the medium will be air because variables such as density, temperature and humidity are equal inside and outside the chamber in the first interval from room temperature to 60 C. The 5 watts electric heating element (Ra) is the actuator in this temperature zone, then the 150-watt electric heating element to heat the systems up to 200C and finally the cooling effect (Rc). It is better to let the system start from rest at room temperature, using equation 1, [8]."
  v:shapes="_x0000_s1049"></td>

  alt="Elaborazione alternativa: In order to observe the dynamic behavior and inertia of the system, data was captured in different scenarios. The first scenario consisted in heating the air with the low-power resistance (5 watts). The second in heating the air with the high-power resistance (150 watts). The third was to cool naturally by disconnecting the heaters until reaching ambient temperature (the slope of the temperature versus time curve is moderate and governed by the heat losses through the walls of the container). Finally, the fourth scenario consisted of the cooling process through the Peltier modules [10].&#13;&#10;&#13;&#10;"
